import React, { Component } from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
import axios from 'axios';

class MapWithLocation extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lat: null,
      lng: null,
      locations:[],
      hospitals: [
      ],
      garages: [
      ],
      query: '',
      filteredLocations: [],
    };
    this.handleSearch = this.handleSearch.bind(this);
  }

  componentDidMount() {
    this._isMounted = true;
    navigator.geolocation.getCurrentPosition(
      (position) => {
        if(this._isMounted) {
          this.setState({
            lat: position.coords.latitude,
            lng: position.coords.longitude,
          });
        }
      },
      () => {
        console.log('Error getting current position');
      }
    );

    axios.get('http://localhost:5000/api/locations')
      .then(response => {
        if (this._isMounted){
          this.setState({
            locations: response.data,
            filteredLocations: response.data,
          });
        }
      })
      .catch(error => {
        console.log(error);
      });
  }

  componentWillUnmount() {
    this._isMounted = false;
  }

  handleSearch(event) {
    const query = event.target.value;
    const { locations } = this.state;
    const filteredLocations = locations.filter((location) =>
      location.name.toLowerCase().includes(query.toLowerCase())
    );
    this.setState({
      query: query,
      filteredLocations: filteredLocations,
    });
  }

  render() {
    const { google } = this.props;
    const { lat, lng, filteredLocations } = this.state;
  
    if (!lat || !lng) {
      return <div>Loading...</div>;
    }
  
    const mapStyles = {
      width: '50%',
      height: '100%',
      position: 'fixed',
      right: 0,
      top: 0,
      margin: '0 20px 0 0', // added margin
    };
  
    const mapOptions = {
      center: { lat, lng },
      zoom: 16,
    };
  
    const searchStyles = {
      width: '50%',
      height: '100%',
      padding: '10px',
      boxSizing: 'border-box',
      margin: '0 0 0 20px', // added margin
    };
  
    const containerStyles = {
      display: 'flex',
      height: '100vh',
    };
  
    return (
      <div style={containerStyles}>
        <div style={searchStyles}>
          <input
            type="text"
            placeholder="Search for a location"
            value={this.state.query}
            onChange={this.handleSearch}
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
        </div>
  
        <div style={{ width: '50%', height: '100vh' }}>
          <Map
            google={google}
            zoom={14}
            style={mapStyles}
            initialCenter={{ lat, lng }}
          >
            <Marker position={{ lat, lng }} /> {/* added current location marker */}
            {filteredLocations.map((location, index) => (
              <Marker key={index} position={{ lat: location.lat, lng: location.lng }} />
            ))}
          </Map>
        </div>
      </div>
    );
  }
}  

export default GoogleApiWrapper({
  apiKey: 'AIzaSyC_9cAGZnlvSGLKRUMCxIgteTpaMvE83oY',
})(MapWithLocation);
